// --- Hash-based Event Detail Overlay ---
function EventDetailOverlay(){
  const [ev, setEv] = React.useState(null);
  React.useEffect(() => {
    const read = async () => {
      const m = (window.location.hash || "").match(/^#\/eventos\/(.+)$/);
      if (m) {
        const data = await getEvent(m[1]);
        setEv(data || { id: m[1], notFound: true });
      } else {
        setEv(null);
      }
    };
    read();
    window.addEventListener("hashchange", read);
    return () => window.removeEventListener("hashchange", read);
  }, []);
  if (!ev) return null;
  const close = ()=>{ try{ window.location.hash=""; }catch{} };
  return (
    <div className="fixed inset-0 z-[1000] flex items-start sm:items-center justify-center">
      <div className="absolute inset-0 bg-black/60 backdrop-blur-sm" onClick={close}/>
      <div className="relative w-full sm:max-w-3xl mx-2 sm:mx-0 rounded-xl border border-zinc-800 bg-zinc-900 p-5 shadow-xl">
        <div className="flex items-center justify-between mb-3">
          <h3 className="text-lg font-semibold text-zinc-100">{ev.notFound ? "Evento não encontrado" : (ev.nome || ev.id)}</h3>
          <button onClick={close} className="px-3 py-1 rounded-md border border-zinc-700 text-zinc-300 hover:bg-zinc-800">Fechar</button>
        </div>
        {ev.notFound ? <p className="text-zinc-300">Não foi possível localizar este evento no armazenamento local.</p> : (
          <div className="grid grid-cols-2 gap-3 text-zinc-200">
            <div><span className="text-zinc-400">ID:</span> {ev.id}</div>
            <div><span className="text-zinc-400">Dia:</span> {ev.dia}</div>
            <div><span className="text-zinc-400">Tipo:</span> {ev.tipo}</div>
            <div><span className="text-zinc-400">Local:</span> {ev.local}</div>
            <div><span className="text-zinc-400">Formato:</span> {ev.formato}</div>
            <div><span className="text-zinc-400">Classificação:</span> {ev.classificacao}</div>
          </div>
        )}
      </div>
    </div>
  );
}


