if (typeof window !== 'undefined') {
  if (!window.__ptcgNovoRegistroDialogRef) window.__ptcgNovoRegistroDialogRef = null;
  if (!window.__ptcgNovoRegistroBtnDelegated) {
    window.__ptcgNovoRegistroBtnDelegated = true;
    window.addEventListener('click', (ev) => {
      try {
        const el = ev.target && (ev.target.closest ? ev.target.closest('button, [role="button"]') : null);
        const txt = (el && (el.textContent || '') || '').replace(/\s+/g, ' ').trim().toLowerCase();
        if (el && txt.includes('novo registro')) {
          if (window.__ptcgNovoRegistroDialogRef && typeof window.__ptcgNovoRegistroDialogRef.open === 'function') {
            ev.preventDefault();
            window.__ptcgNovoRegistroDialogRef.open();
          } else if (typeof window.__ptcgSetNovoOpen === 'function') {
            ev.preventDefault();
            window.__ptcgSetNovoOpen(true);
          } else {
            console.warn('Dialog ref ainda não está pronto');
          }
        }
      } catch (e) { /* no-op */ }
    }, true);
  }
}


