export const labelFromKind = (k) => (
  {
    local: "Liga Local",
    cup: "Cup",
    challenge: "Challenge",
    regional: "Regional",
    special: "Special Event",
    international: "Internacional",
    worlds: "Mundial",
  }[k] || "—"
);

export const countsFrom = (rows = []) => wlCounts(rows);

export const winRate = (counts = {}) => winRateFromCounts(counts);

export const clampPage = (p, totalPages) => {
  const n = Number.isFinite(p) ? p : 1;
  return Math.min(Math.max(1, n), Math.max(1, totalPages || 1));
};

const fmtMDY = (tsOrDate) => {
  const d = tsOrDate instanceof Date ? tsOrDate : new Date(tsOrDate);
  const mm = String(d.getMonth() + 1).padStart(2, "0");
  const dd = String(d.getDate()).padStart(2, "0");
  const yyyy = d.getFullYear();
  return `${mm}/${dd}/${yyyy}`;
};

const fmtYMD = (tsOrDate) => {
  const d = tsOrDate instanceof Date ? tsOrDate : new Date(tsOrDate);
  const yyyy = d.getFullYear();
  const mm = String(d.getMonth() + 1).padStart(2, "0");
  const dd = String(d.getDate()).padStart(2, "0");
  return `${yyyy}-${mm}-${dd}`;
};


